import React from 'react';
import { Icon } from 'semantic-ui-react';

export const DeleteIcon = (props) => {
  return (
    <Icon 
      name='times'
      size='small'
      style={{ visibility: props.hovering ? 'visible' : 'hidden' }}
    />
  )
};

export const AddIcon = (props) => {
  const style = {
    visibility: props.hovering ? 'visible' : 'hidden',
    float: 'right'
  }
  return (
    <Icon 
      name='plus'
      size='small'
      style={style}
    />
  )
};
